import './Movies.css';
const Movies = () => {
  const movies = [
    [{
        name: 'Hello',
        email: 'somewhere@gmail.com'
     },
     {
        name: 'Ash',
        email: 'something@gmail.com'
     }
    ]
  ];
  return (
    <div className="movie-wrapper px-4 grid md:grid-cols-3">

      {movies.map((movie, index) => {
        return <button key= {index} className=" bg-white text-[#266b7a] px-12 py-4 mr-2 my-2 font-normal text-xl border border-[#a9afb1] rounded">
          {movie}</button>;
      })}
    </div>
  );
};

export default Movies;
